import { listsService } from "/src/services/api.ts";

/**
 * Query key factory for lists
 */
export const listsKeys = {
  all: ['lists'],
  lists: () => [...listsKeys.all, 'list'],
  list: (filters) => [...listsKeys.lists(), filters],
};

/**
 * Hook to fetch paginated lists
 * @param {Object} params - Query parameters
 * @param {Object} options - React Query options
 */
export const useLists = (params = {}, options = {}) => {
  return useQuery({
    queryKey: listsKeys.list(params),
    queryFn: () => listsService.getLists(params),
    staleTime: 5 * 60 * 1000, // 5 minutes
    ...options,
  });
};

/**
 * Hook to save lists (create/update)
 */
export const useSaveLists = () => {
  const queryClient = useQueryClient();

  return useMutation({
    mutationFn: (lists) => listsService.saveLists(lists),
    onSuccess: () => {
      queryClient.invalidateQueries({ queryKey: listsKeys.lists() });
    },
  });
};

/**
 * Hook to view list details
 */
export const useViewLists = () => {
  const queryClient = useQueryClient();

  return useMutation({
    mutationFn: (viewLists) => listsService.viewLists(viewLists),
    onSuccess: () => {
      queryClient.invalidateQueries({ queryKey: listsKeys.lists() });
    },
  });
};

export default useLists;

